import React from "react";
import { makeStyles, Typography } from "@material-ui/core";

const useStyles = makeStyles({
  outerContainer: {
    width: "100vw",
    height: 1000,
    backgroundColor: "#01176C",
    position: "relative",
  },
  polygonBackground: {
    width: "100vw",
    height: 411,
    background:
      "transparent linear-gradient(180deg, #028D9ADE 0%, #8F749CE6 100%) 0% 0% no-repeat padding-box",
    clipPath:
      "polygon(0% 0%, 0% 100%, 15% 80%, 30% 90%, 45% 80%, 60% 90%, 75% 75%, 90% 95%, 100% 100%, 100% 0%)",
    zIndex: -1,
  },
  container: {
    width: "100vw",
    position: "absolute",
    top: 0,
    left: 0,
    display: "flex",
    flexDirection: "column",
    // justifyContent: "center",
    paddingLeft: "5%",
    paddingRight: "5%",
  },
  titleContainer: {

  }
});

const Intro: React.FC<{}> = () => {
  const classes = useStyles();

  return (
    <div className={classes.outerContainer}>
      <div className={classes.polygonBackground}></div>
      <div className={classes.container}>
          <div className={classes.titleContainer}></div>
      </div>
    </div>
  );
};

export default Intro;
